import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const AppWrapper = () => {
  const [theme, setTheme] = useState('dark');

  return (
    <App theme={theme} setTheme={setTheme} />
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <AppWrapper />
  </React.StrictMode>
);
